package week1.day1;

public class Factorial {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int a = 5,b = 1,i;
		
		for(i=1;i<=a;i++)
		{ 
			//System.out.println(i);
			b=b*i;
			//System.out.println(b);
		}	
		System.out.println("Factorial Output: "+b);
		
	}

}
